s.com/60d0c29c2e1261708dd228ea/64832bd99897d3e601bf4377_iphone-frame-p-1600.png 1600w, https://assets.website-files.com/60d0c29c2e1261708dd228ea/64832bd99897d3e601bf4377_iphone-frame.webp 2010w" alt="" class="home-header_iphone" style="will-change: opacity; opacity: 1;" /><div class="home-header_phone-bg" style="will-change: opacity; opacity: 1;"></div></div>
                    </div>
                </div>
                <div className='image-section'>
                    <img src={QRCode} alt="Home Page Image"  className="qrcode-image"/>
                </div> 
            </div>
        </div>
    )
}

